import React, { useRef, useState } from 'react';
import { Canvas, useFrame } from '@react-three/fiber';
import { Text3D, Float, OrbitControls, Environment } from '@react-three/drei';
import { motion } from 'framer-motion-3d';
import styled from 'styled-components';

const TextContainer = styled.div`
  width: 100%;
  height: 400px;
  position: relative;
  overflow: hidden;
  background: ${props => props.theme === 'dark' 
    ? 'linear-gradient(135deg, #1a1a2e 0%, #16213e 50%, #0f3460 100%)'
    : 'linear-gradient(135deg, #f8f9fa 0%, #e9ecef 50%, #dee2e6 100%)'};
`;

const FloatingText = ({ children, position, color, theme }) => {
  const meshRef = useRef();
  const [hovered, setHovered] = useState(false);

  useFrame((state) => {
    if (meshRef.current) {
      meshRef.current.rotation.y = Math.sin(state.clock.elapsedTime * 0.5) * 0.1;
      meshRef.current.position.y = Math.sin(state.clock.elapsedTime * 0.8) * 0.1;
    }
  });

  return (
    <Float
      speed={2}
      rotationIntensity={0.5}
      floatIntensity={0.5}
      floatingRange={[-0.1, 0.1]}
    >
      <motion.group
        ref={meshRef}
        position={position}
        animate={{
          scale: hovered ? 1.1 : 1,
          rotateY: hovered ? Math.PI * 0.1 : 0,
        }}
        transition={{ duration: 0.3 }}
        onPointerEnter={() => setHovered(true)}
        onPointerLeave={() => setHovered(false)}
      >
        <Text3D
          font="/fonts/helvetiker_regular.typeface.json"
          size={0.5}
          height={0.2}
          curveSegments={12}
          bevelEnabled
          bevelThickness={0.02}
          bevelSize={0.02}
          bevelOffset={0}
          bevelSegments={5}
        >
          {children}
          <meshStandardMaterial
            color={color}
            metalness={0.8}
            roughness={0.2}
            emissive={hovered ? color : '#000000'}
            emissiveIntensity={hovered ? 0.3 : 0}
          />
        </Text3D>
      </motion.group>
    </Float>
  );
};

const ParticleSystem = () => {
  const particlesRef = useRef();
  const particleCount = 100;

  useFrame((state) => {
    if (particlesRef.current) {
      const positions = particlesRef.current.geometry.attributes.position.array;
      for (let i = 0; i < particleCount * 3; i += 3) {
        positions[i + 1] += Math.sin(state.clock.elapsedTime + i) * 0.01;
        positions[i] += Math.cos(state.clock.elapsedTime + i) * 0.01;
      }
      particlesRef.current.geometry.attributes.position.needsUpdate = true;
    }
  });

  return (
    <points ref={particlesRef}>
      <bufferGeometry>
        <bufferAttribute
          attach="attributes-position"
          count={particleCount}
          array={new Float32Array(particleCount * 3).map(() => (Math.random() - 0.5) * 10)}
          itemSize={3}
        />
      </bufferGeometry>
      <pointsMaterial
        size={0.05}
        color="#00d4ff"
        transparent
        opacity={0.6}
        sizeAttenuation
      />
    </points>
  );
};

const ThreeDText = ({ theme }) => {
  return (
    <TextContainer theme={theme}>
      <Canvas
        camera={{ position: [0, 0, 5], fov: 75 }}
        style={{ background: 'transparent' }}
      >
        <ambientLight intensity={0.5} />
        <pointLight position={[10, 10, 10]} intensity={1} />
        <pointLight position={[-10, -10, -10]} intensity={0.5} />

        <FloatingText
          position={[-2, 1, 0]}
          color="#00d4ff"
          theme={theme}
        >
          PORTFOLIO
        </FloatingText>

        <FloatingText
          position={[2, -1, 0]}
          color="#ff6b6b"
          theme={theme}
        >
          CREATIVE
        </FloatingText>

        <FloatingText
          position={[0, 0, 1]}
          color="#4ecdc4"
          theme={theme}
        >
          DEVELOPER
        </FloatingText>

        <ParticleSystem />

        <Environment preset="city" />
        <OrbitControls
          enableZoom={false}
          enablePan={false}
          autoRotate
          autoRotateSpeed={0.5}
        />
      </Canvas>
    </TextContainer>
  );
};

export default ThreeDText;
